.button {
    display: none;
    cursor: pointer;
    width: 6rem;
    height: 6rem;

    border: none;
    border-radius: 50%;
    position: fixed;
    right: 2%;
    top: 3rem;
    background-color: transparent;
    z-index: 100;
    transition: all 0.5s;
    transform: translateY(-2rem);

    @include mq(ip) {
        display: inline-block;
    }
}

.hum {
    display: none;
    height: 2.5px;
    width: 3.5rem;
    background-color: $color-black;
    position: relative;
    display: inline-block;
    text-align: center;
    margin-top: 1.5rem;
    z-index: 100;

    &::before, &::after {
        content: '';
        display: inline-block;
        height: 2.5px;
        width: 3.5rem;
        background-color: $color-black;
        position: absolute;
        top: -1.2rem;
        left: 0;
        transition: all 0.25s;
    }

    &::after {
        top: 1.2rem;
    }

    @include mq(ip) {
        display: inline-block;
    }

}

