.open .menu {
    right: 0;
    opacity: 1;

}

.open .button span {
    background-color: transparent;
}

.open .button span::before {
    transform: translateY(1.2rem) rotate(-315deg);
}
.open .button span::after {
    transform: translateY(-1.2rem) rotate(315deg);
}


.open #mask {
    display: block;
    background-color: $color-black;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    position: fixed;
    opacity: 0.6;
